CREATE       PROCEDURE [dbo].[Identity_InsertUploadProfilePicture]         
(     
 @UserId VARCHAR(100) = NULL,            
 @ProfilePictureID VARCHAR(100) = NULL,          
 @ProfilePictureFileName VARCHAR(200) = NULL,      
 @ProfilePictureStoragePath VARCHAR(MAX) = NULL ,  
 @DocumentId VARCHAR(100) = NULL  
)          
AS

BEGIN
	BEGIN TRY
		BEGIN TRANSACTION
		DECLARE @Identity_User table([UserId] [uniqueidentifier]);
		DECLARE @insertedUserId varchar(100);
		INSERT INTO [dbo].[Identity_User]
           (
            [UserName]
		   ,[EmpID]           
           ,[MobileNo]
		   ,[EmailId]           
           ,[Gender]
           ,[DOB]
           ,[RoleId]
           ,[CreatedBy]
           ,[isActive]
           )
		    OUTPUT INSERTED.[UserId] INTO @Identity_User
     VALUES
            (@UserName,
			@EmpID  ,
			@MobileNo  ,
			@EmailId   ,
			@Gender  ,
		    @DOB      ,		  
			@RoleId   ,
			@CreatedBy,
			@StatusUser)
		 IF EXISTS( SELECT [UserId] FROM @Identity_User)
			 BEGIN
			       SELECT @insertedUserId = [UserId] FROM @Identity_User;
			       print 'Current userid ' + @insertedUserId
					INSERT INTO [dbo].[Identity_UserRoleMapping]
					   (
						[RoleTypeID]		 
					   ,[IdentityRoleId] 
                       ,[ReportingIdentityRoleId]					  
					   ,[UserID]
					   ,[ReportingUserID]
					   ,[CategoryID]
					   ,[isActive]
					   )
					VALUES
					   (
						@RoleTypeID,
						@IdentityRoleId,
						@ReportingIdentityRoleId,
						@insertedUserId , --Current inserted userid
						@ReportingUserID ,
						@CategoryID ,
						@StatusRoleUser
					   )
			 END

	 	IF @@TRANCOUNT > 0
            COMMIT
	END TRY                
	BEGIN CATCH          
	IF @@TRANCOUNT > 0
        ROLLBACK  
		DECLARE @StrProcedure_Name varchar(500), @ErrorDetail varchar(1000), @ParameterList varchar(2000)                            
		SET @StrProcedure_Name=ERROR_PROCEDURE()                            
		SET @ErrorDetail=ERROR_MESSAGE()                            
		EXEC Identity_InsertErrorDetail @StrProcedure_Name=@StrProcedure_Name,@ErrorDetail=@ErrorDetail,@ParameterList=@ParameterList                             
	END CATCH

END

